    <div>
    <p class=MsoNormal style='text-align:justify'><span style='font-size:18.0pt;
    line-height:107%'>México es el décimo país más poblado del mundo, con una
    población estimada en más de 130 millones de personas en 2021.22&#8203; La
    mayoría de ellas tiene como lengua materna el español, al que el estado
    reconoce como lengua nacional junto a 68 lenguas indígenas propias del
    país, &#8203; si bien en el país se hablan alrededor de 287 variedades
    lingüísticas.&#8203; Estas cifras convierten a México en el país con mayor
    número de hispanohablantes, &#8203; así como en el séptimo país con mayor
    diversidad lingüística en el mundo.<o:p></o:p></span></p>
    <p class=MsoNormal align=center style='text-align:center'><b><span
    style='font-size:90.0pt;line-height:107%'><o:p>&nbsp;</o:p></span></b></p>
    </div>
